var weightedGraph = ['AB1', 'AC4', 'AD10', 'BE3', 'CD4', 'CF2', 'DE1', 'EB3', 'EA2', 'FD1'];

var availableRoutes = weightedGraph.map((item) => {
    return item.substring(0, 2);
})
console.log(availableRoutes);
